import React from 'react';
import resumedata from './resumedata'

const Resume=({match})=>{

    const data= match.params.name;
    const res_data= resumedata.find(a=>a.name===name);
    return(
    <h1>Welcome to {res_data}'s resume page!</h1>

    )
}   


export default Resume;
